import React from "react";

function ListItem(props) {
  return (
    <React.Fragment>
      <p>
        <image src={props.avatar} /> 
        Name - {props.name}
      </p>
      <p>City - {props.city}</p>
      <p>Email- {props.email}</p>
      <p>birthday - {props.birthday}</p>
    </React.Fragment>
  );
}

export default ListItem;
